import  { green, yellow } from "@mui/material/colors"
import { createTheme  } from '@mui/material/styles';

export const myTheme = createTheme({
  palette:{
      primary:{
          main: '#fcfcfc'
      },
      secondary:{
          main: '#fafafa'
      },
      tertiary:{
        main: '#f9f9f9'
      },
      warning:{
          main: yellow[600]
      },
      info:{
          main: green[600]
      },
      text:{
        main: '#000000' 
      }
  }
})
